import React from 'react'
import styled from 'styled-components';

const TextWrapper=styled.div``;
const PictureWrapper=styled.div``;
const DealsGrabContainer=styled.div`
text-align: center;
 background-color: #FEDE17;
// padding-top: 40px;
// padding-bottom: 40px;
`;
const DealsWrapper=styled.div`
 padding-top: 40px;
 padding-bottom: 40px;
`;

const Deals = () => {
    return (
        <DealsGrabContainer>
            <DealsWrapper>
            <h1>
             Grab your Deals Now
            </h1>
            </DealsWrapper>
           
        <div class="container">
        <div class="row">
          <div class="col">
              <TextWrapper>
                  <h1>Text</h1>
              </TextWrapper>
          </div>
          <div class="col">
              <PictureWrapper>
                  <h1>Picture</h1>
              </PictureWrapper>
          </div>
        </div>
      </div>
      </DealsGrabContainer>
    )
}

export default Deals
